ku‘ a ‚search_sku‘.','Usage limit for coupon "%s" has been reached.'=>'Byl dosažen limit použití pro kupón „%s“.','Coupon "%s" has expired.'=>'Platnost kupónu „%s“ již vypršela.','Usage limit for coupon "%s" has been reached. Please try again after some time, or contact us for help.'=>'Byl dosažen limit použití pro kupón „%s“. Zkuste to později, nebo se obraťte na naši podporu.','The maximum spend for coupon "%1$s" is %2$s.'=>'Maximální hodnota objednávky pro kupón „%1$s“ je %2$s.','The minimum spend for coupon "%1$s" is %2$s.'=>'Minimální hodnota objednávky pro kupón „%1$s“ je %2$s.','Hide shipping rates when free shipping is available'=>'Skrýt náklady na dopravu, pokud je k dispozici doprava zdarma','Features that are currently enabled.'=>'Aktuálně povolené funkce.','Enabled features:'=>'Povolené funkce:','Information about the operating system your server is running.'=>'Informace o operačním systému serveru.','Server architecture'=>'Architektura serveru','Revert to legacy template'=>'Vrátit se zpět ke starší verzi šablony','This tool allows you to generate and download a CSV file containing the selected products.'=>'Tento nástroj umožňuje generovat a stáhnout soubor CSV obsahující vybrané produkty.','You are about to export %1$d product. To export all products, <a href="%2$s">clear your selection</a>.'=>'Chystáte se exportovat %1$d produkt. Pokud chcete exportovat všechny produkty, <a href="%2$s">zrušte výběr</a>.' . "\0" . 'Chystáte se exportovat %1$d produkty. Pokud chcete exportovat všechny produkty, <a href="%2$s">zrušte výběr</a>.' . "\0" . 'Chystáte se exportovat %1$d produktů. Pokud chcete exportovat všechny produkty, <a href="%2$s">zrušte výběr</a>.','Are you sure want to revert to legacy? Doing so will erase any changes you’ve made to your new email templates, and will restore your previous email designs.'=>'Opravdu se chcete vrátit ke starší verzi? Tímto smažete všechny změny provedené v nových šablonách e-mailů a obnovíte předchozí vzhled e-mailů.','Co