 o dostupnosti produktu.','Stock availability class.'=>'Třída dostupnosti skladu.','HPOS Data Caching'=>'Mezipaměť dat HPOS','Enables rate limiting for Checkout place order and Store API /checkout endpoint. To further control this, refer to <a href="%s" target="_blank">rate limiting documentation</a>.'=>'Povolí omezení počtu požadavků pro dokončení objednávky v pokladně a pro endpoint Store API /checkout. Podrobnější možnosti nastavení naleznete v <a href="%s" target="_blank">dokumentaci k omezení požadavků</a>.','Rate limit Checkout'=>'Omezení požadavků v pokladně','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell in store and track sales and inventory in one place.'=>'Bezpečně přijímejte kreditní a debetní karty s jedním nízkým poplatkem a bez skrytých poplatků (možné individuální sazby). Prodávejte v kamenné prodejně a sledujte prodeje i zásoby na jednom místě.','Enable PayU\'s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Aktivujte exkluzivní plugin PayU pro WooCommerce a začněte přijímat platby pomocí více než 100 způsobů platby dostupných v Indii – včetně kreditních karet, debetních karet, UPI a dalších!','Clearpay'=>'Clearpay','Credit/debit cards, Apple Pay, Google Pay, and more.'=>'Kreditní/debetni karty, Apple Pay, Google Pay a další.','Accept payments with Woo'=>'Přijímat platby přes Woo','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Evropské řešení plateb, které umožňuje přijímat platby ve více než 25 zemích a mnoha měnách.','Tilopay'=>'Tilopay','Stripe'=>'Stripe','PayU India'=>'PayU India','Viva.com Smart Checkout'=>'Viva.com Smart Checkout','Clearpay allows customers to receive products immediately and pay for purchases over four installments, always interest-free.'=>'Clearpay umožňuje zákazníkům získat produkty ihned a zaplatit za ně ve čtyřech splátkách – vždy bez navýšení.','Accept credit and debit cards on your WooCommerce store with advanced features like partial refunds, full/partial captures, and 3D Secure security.'=>'Přijímejte kreditní a debetní karty ve svém obchodě WooCommerce s pokročilými funkcemi, jako jsou částečné refundace, plné/částečné blokace plateb a zabezpečení 3D Secure.','Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today\'s hyper-competitive global market.'=>'Payoneer Checkout je moderní platforma pro zpracování plateb, která pomáhá obchodníkům uspět na globálním trhu.','Affirm\'s tailored Buy Now Pay Later programs remove price as a barrier, turning browsers into buyers, increasing average order value, and expanding your customer base.'=>'Programy Affirm na míru „Koupit nyní, zaplatit později“ odstraňují cenu jako bariéru, mění prohlížející stránky v kupující, zvyšují průměrnou hodnotu objednávky a rozšiřují vaši zákaznickou základnu.','PayPal Payments lets you offer PayPal, Venmo (US only), Pay Later options and more.'=>'Služba PayPal Payments vám umožní nabízet PayPal, Venmo (pouze v USA), odložené platby a další možnosti.','Safe and secure payments using your customer\'s PayPal account.'=>'Bezpečné a spolehlivé platby pomocí PayPal účtu zákazníka.','Paymob'=>'Paymob','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozšíření PayFast pro WooCommerce umožňuje přijímat platby kreditní kartou a EFT prostřednictvím jedné z nejoblíbenějších platebních bran v Jižní Africe. Žádné instalační poplatky ani náklady na měsíční předplatné. Výběrem tohoto rozšíření nakonfigurujete svůj obchod tak, aby jako vybranou měnu používal jihoafrické randy.','Paymob is a leading payment gateway in the Middle East and Africa. Accept payments online and in-store with Paymob.'=>'Paymob je platební brána pro Blízký východ a Afriku. Podporuje platby online i v prodejnách.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'ID propagační pobídky. Toto ID je třeba předat do procesu zprovoznění.','The incentive description. It can contain stylistic HTML.'=>'Popis propagační pobídky. Může obsahovat stylizační HTML.','The incentive title. It can contain stylistic HTML.'=>'Název propagační pobídky. Může obsahovat stylizační HTML.','The URL to dismiss the incentive.'=>'URL adresa pro skrytí propagační pobídky.','The link to dismiss the incentive.'=>'Odkaz pro skrytí propagační pobídky.','Context ID in which the incentive was dismissed.'=>'ID kontextu, ve kterém byla propagační pobídka skryta.','The URL to the terms and conditions for the incentive.'=>'URL adresa obchodních podmínek propagační pobídky.','The short description of the incentive. It can contain stylistic HTML.'=>'Krátký popis propagační pobídky. Může obsahovat stylizační HTML.','The URL of the icon (square aspect ratio).'=>'URL adresa ikony (ve čtvercovém poměru stran).','The URL of the image.'=>'URL adresa obrázku.','A suggestion with full details.'=>'Doporučení se všemi podrobnostmi.','The URL to hide the suggestion.'=>'URL adresa pro skrytí doporučení.','The link to hide the suggestion.'=>'Odkaz pro skrytí doporučení.','The category of the suggestion.'=>'Kategorie tohoto doporučení.','The tags associated with the suggestion.'=>'Štítky přiřazené tomuto doporučení.','The description of the suggestion.'=>'Popis doporučení.','The title of the suggestion.'=>'Název doporučení.','The type of the suggestion.'=>'Typ doporučení.','The priority of the suggestion.'=>'Priorita doporučení.','The unique identifier for the suggestion.'=>'Jedinečný identifikátor doporučení.','Antom'=>'Antom','Your trusted payments partner in Asia and around the world.'=>'Váš důvěryhodný partner pro Asii a zbytek světa.','The badge label for the incentive.'=>'Popisek odznaku propagační pobídky.','The call to action label for the incentive.'=>'Popisek tlačítka výzvy k akci pro propagační pobídku.','The title of the payment method. Does not include HTML tags.'=>'Název způsobu platby. HTML značky nejsou povoleny.','Whether the payment method should be required (and force-enabled) or not.'=>'Zda má být způsob platby povinný (a vynuceně povolený), nebo ne.','Whether the payment method should be recommended as enabled or not.'=>'Zda má být způsob platby doporučen jako povolený.','The sort order of the payment method.'=>'Pořadí zobrazení způsobu platby.','The unique identifier for the payment method.'=>'Jedinečný identifikátor způsobu platby.','The details for a recommended payment method.'=>'Podrobnosti o doporučeném způsobu platby.','The list of recommended payment methods details for the payment gateway.'=>'Seznam podrobností o doporučených způsobech platby pro platební bránu.','The description of the payment method. It can contain basic HTML.'=>'Popis způsobu platby. Může obsahovat základní HTML.','The URL of the payment method icon or a base64-encoded SVG image.'=>'URL ikony platební metody nebo SVG obrázek ve formátu base64.','The URL of the link.'=>'URL adresa odkazu.','The type of the link.'=>'Typ odkazu.','The status of the plugin.'=>'Stav pluginu.','The plugin main file. This is a relative path to the plugins directory.'=>'Hlavní soubor pluginu. Jedná se o relativní cestu k adresáři s pluginy.','The URL of the provider image.'=>'URL adresa obrázku poskytovatele.','Links for the provider.'=>'Odkazy na poskytovatele.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'URL adresa ikony poskytovatele (čtvercový poměr stran – 72 × 72 px).','Whether the provider is enabled for use on checkout.'=>'Zda je poskytovatel povolen pro použití v pokladně.','The general state of the provider with regards to it\'s payments processing.'=>'Obecný stav poskytovatele z hlediska zpracování plateb.','Whether the onboarding process is started.'=>'Zda byl proces zprovoznění zahájen.','The state of the onboarding process.'=>'Stav procesu zprovonění.','Onboarding-related details for the provider.'=>'Podrobnosti o zprovoznění od poskytovatele.','The URL to start/continue onboarding for the payment gateway.'=>'URL adresa začátku/pokračování zprovoznění platební brány.','The start/continue onboarding link for the payment gateway.'=>'Odkaz začátku/pokračování zprovoznění platební brány.','Whether the onboarding process is completed.'=>'Zda je proces zprovoznění dokončen.','The URL to the settings page for the payment gateway.'=>'URL adresa stránky s nastavením platební brány.','The link to the settings page for the payment gateway.'=>'Odkaz na stránku s nastavením platební brány.','The management details of the provider.'=>'Podrobnosti o správě od poskytovatele.','Whether the provider needs setup.'=>'Zda poskytovatel vyžaduje nastavení.','Whether the provider is in dev mode. Having this true usually leads to forcing test payments. '=>'Zda je poskytovatel v režimu vývoje. Pokud je tato možnost aktivní, obvykle to znamená vynucení testovacích plateb. ','Whether the provider is in test mode for payments processing.'=>'Zda je poskytovatel ve testovacím režimu zpracování plateb.','Whether the provider has a payments processing account connected.'=>'Zda má poskytovatel připojený účet pro zpracování plateb.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Jedinečné ID propagační pobídky. Toto ID je třeba použít pro její skrytí.','The active incentive for the provider.'=>'Aktivní propagační pobídka pro poskytovatele.','The tags associated with the provider.'=>'Štíttky přiřazené poskytovateli.','Tag associated with the provider.'=>'Štítek přiřazený poskytovateli.','The suggestion ID matching this provider.'=>'ID doporučení odpovídajícího