e an object with provider IDs as keys and numeric values as values.'=>'Argument ordering musí být objekt, ve kterém jsou klíčem ID poskytovatele a hodnotou číselná hodnota určující pořadí.','The type of payment provider. Use this to differentiate between the various items in the list and determine their intended use.'=>'Typ poskytovatele plateb. Použijte k rozlišení jednotlivých položek v seznamu a určení jejich účelu.','The sort order of the provider.'=>'Pořadí řazení poskytovatele.','A payment provider in the context of the main Payments Settings page list.'=>'Poskytovatel plateb v kontextu hlavního seznamu na stránce Nastavení plateb.','The location argument must be a valid ISO3166 alpha-2 country code.'=>'Argument lokality musí být platný ISO3166 alpha-2 kód země.','The ordering argument must be an object.'=>'Argument seřazení musí být objekt.','The location argument must be a string.'=>'Argument lokality musí být řetězec.','ISO3166 alpha-2 country code. Defaults to WooCommerce\'s base location country.'=>'Kód země podle normy ISO3166 alpha-2. Výchozí hodnota odpovídá zemi e-shopu.','The ISO3166 alpha-2 country code to save for the current user.'=>'Kód země podle normy ISO3166 alpha-2, který bude uložen u aktuálního uživatele.','Take offline payments'=>'Přijímejte offline platby','Selling platforms.'=>'Prodejní platformy.','Selling online answer.'=>'Odpověď na otázku Prodáváte online.','Business choice.'=>'Výběr modelu prodeje.','The Core Profiler step to mark as complete.'=>'Krok v Core Profileru, který se má dokončit.','Reusable template part for displaying social links on the coming soon page.'=>'Znovupoužitelná část šablony pro zobrazení odkazů na sociální sítě na stránce „Již brzy“.','Template nameComing soon social links'=>'Odkazy na sociální sítě na stránce „Již brzy“','Coming Soon template headingStay tuned.'=>'Sledujte nás.','Something big is brewing! Our store is in the works – Launching shortly!'=>'Připravujeme pro vás něco výjimečného. Spuštění obc