nt.'=>'Objednávka čeká na potvrzení platby. Zásoby byly sníženy, ale platbu je třeba potvrdit.','The order has been received, but no payment has been made. Pending payment orders are generally awaiting customer action.'=>'Objednávka byla přijata, ale platba zatím nebyla provedena. Objednávky s čekající platbou obvykle vyžadují akci ze strany zákazníka.','HPOS tables do not exist.'=>'Tabulky HPOS zatím nebyly vytvořeny.','Wrong response received from the Patterns Toolkit API: try again later.'=>'Z rozhraní Patterns Toolkit API byla přijata chybná odpověď. Zkuste to znovu později.','Empty response received from the Patterns Toolkit API.'=>'Z rozhraní Patterns Toolkit API byla přijata prázdná odpověď.','Failed to connect with the Patterns Toolkit API: try again later.'=>'Nepodařilo se připojit k rozhraní Patterns Toolkit API. Zkuste to znovu později.','Order fulfilled and complete.'=>'Objednávka byla expedována a dokončena.','Empty patterns received from the PTK Pattern Store'=>'Z úložiště šablon PTK byly načteny prázdné předlohy.','Used in sentence: You can try clearing any filters or head to our store\'s home.You can try'=>'Můžete zkusit','Message explaining that there are no products foundNo results found'=>'Nebyly nalezeny žádné výsledky','Pardon our dust! We\'re working on something amazing — check back soon!'=>'Omluvte nepořádek! Pracujeme na něčem skvělém — vraťte se brzy zpět!','Sync all your selling channels in one place'=>'Synchronizujte všechny své prodejní kanály na jednom místě','button label of product search blockSearch'=>'Hledat','Used in sentence: You can try clearing any filters or head to our store\'s home.store\'s home'=>'domovská stránka obchodu','Discounted labels from top global carriers'=>'Zlevněné přepravní štítky od předních globálních dopravců','Instantly send tracking to your customers'=>'Okamžitě odesílat sledovací číslo zásilky zákazníkům','Used in sentence: You can try clearing any filters or head to our store\'s home.clearing any fi