om your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Nastavte své způsoby platby a přijímejte kreditní a debetní karty, hotovost, bankovní převody a peníze ze svého účtu Mercado Pago. Nabídněte bezpečné a zabezpečené platby s předním zpracovatelem v Latinské Americe.','Add your products'=>'Přidejte své produkty','Grow your business'=>'Rozvíjejte své podnikání','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Je čas slavit – jste připraveni spustit svůj obchod! Woo! Klepnutím na tlačítko zobrazíte náhled svého obchodu a zveřejníte jej.','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Účtovat daň z prodeje','Current price is: %s.'=>'Aktuální cena je: %s.','Get your products shipped'=>'Nechte si zaslat své produkty','Launch your store'=>'Spusťte svůj obchod','Original price was: %s.'=>'Původní cena byla: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Pokladnu lze upravit <a href="%s">v Editoru</a> pomocí vašeho aktivního tématu.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce se pokusil nainstalovat <a href="%1$s">plugin Legacy REST API,</a> protože tento web má <a href="%2$s">povoleno Legacy REST API</a> nebo má <a href="%3$s">definované starší webhooky</a> , ale instalace se nezdařila (viz podrobnosti o chybě v <a href="%4$s">protokolech WooCommerce</a> ). Nainstalujte a aktivujte plugin ručně. <a href="%5$s">Více informací</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce nainstaloval a aktivoval <a href="%1$s">plugin Legacy REST API</a> , protože tento web má <a href="%2$s">povoleno Legacy REST API</a> nebo má <a href="%3$s">definované starší webhooky</a> . <a href="%4$s">Více informací</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce nainstaloval plugin Legacy REST API, ale nepodařilo se jej aktivovat, další podrobnosti najdete v kontextu.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce nainstaloval <a href="%1$s">plugin Legacy REST API</a> , protože tento web má <a href="%2$s">povoleno Legacy REST API</a> nebo má <a href="%3$s">definované starší webhooky</a> , ale nepodařilo se jej aktivovat (viz podrobnosti o chybě v <a href="%4$s">protokolech WooCommerce</a> ). Přejděte prosím na <a href="%5$s">stránku pluginů</a> a aktivujte jej ručně. <a href="%6$s">Více informací</a>','To allow logging, make %s writable.'=>'Chcete-li povolit protokolování, udělejte %s zapisovatelný.','Please enter a valid email to use coupon code "%s".'=>'Chcete-li použít kupon "%s", zadejte prosím platný e-mail.','Please enter a valid email at checkout to use coupon code "%s".'=>'Chcete-li použít kupon "%s", zadejte v pokladně platný e-mail.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Prozkoumejte nový vylepšený způsob doručení, který vám umožní snadno nabídnout jedno nebo více míst vyzvednutí vašim zákazníkům na <a href="%s">stránce Nastavení místního vyzvednutí</a> .','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Místní vyzvednutí: Nastavte místa vyzvednutí na <a href="%s">stránce Nastavení místního vyzvednutí</a> .','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Shromažďování údajů o využití nám umožňuje přizpůsobit nastavení vašeho obchodu, nabízet relevantnější obsah a pomoci vylepšit WooCommerce pro všechny.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Nainstalujte si prosím Správce aktualizací WooCommerce.com</a> , abyste i nadále dostávali aktualizace a přednostní podporu, která je součástí vašich předplatných WooCommerce.com. Případně si jej můžete <a href="%2$s">stáhnout</a> a nainstalovat ručně.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Aktivujte si prosím Správce aktualizací WooCommerce.com</a> , abyste mohli nadále dostávat aktualizace a přednostní podporu, která je součástí vašich předplatných WooCommerce.com.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' Pro aktualizaci <a href="%1$s">nainstalujte WooCommerce.com Update Manager</a> .',' Activate WooCommerce.com Update Manager to update.'=>' Pro aktualizaci aktivujte WooCommerce.com Update Manager.','block keywordtextarea'=>'textové pole','block descriptionA text-area field for use in the product editor.'=>'Textové pole pro použití v editoru produktu.','block titleProduct textarea block'=>'Blokt prod