ame of the state, county, province, or district.'=>'Kód státu/kraje nebo název státu, kraje, provincie nebo okresu.','Price prefix for the currency which can be used to format returned prices.'=>'Předpona ceny pro měnu, kterou lze použít k formátování vrácených cen.','Thousand separator for the currency which can be used to format returned prices.'=>'Oddělovač tisíců pro měnu, kterou lze použít k formátování vrácených cen.','Decimal separator for the currency which can be used to format returned prices.'=>'Oddělovač desetinných míst pro měnu, kterou lze použít k formátování vrácených cen.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Menší jednotka měny (počet číslic za desetinným oddělovačem) pro vrácené ceny.','Currency symbol for the currency which can be used to format returned prices.'=>'Symbol měny pro měnu, kterou lze použít k formátování vrácených cen.','Currency code (in ISO format) for returned prices.'=>'Kód měny (ve formátu ISO) pro vrácené ceny.','Total amounts provided using the smallest unit of the currency.'=>'Celkové částky poskytnuté s použitím nejmenší jednotky měny.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL k přesměrování zákazníka po zaplacení. Může to být například odkaz na web zpracovatele plateb.','ID of the shipping method that provided the rate.'=>'ID způsobu dopravy, který poskytl sazbu.','Price of this shipping rate using the smallest unit of the currency.'=>'Cena této přepravní sazby za použití nejmenší jednotky měny.','Delivery time estimate text, e.g. 3-5 business days.'=>'Text odhadu doby dodání, např. 3-5 pracovních dnů.','Description of the shipping rate, e.g. Dispatched via USPS.'=>'Popis sazby za dopravu, např. Odesláno přes USPS.','Name of the shipping rate, e.g. Express shipping.'=>'Název sazby za dopravu, např. Expresní doprava.','Quantity of the item in the current package.'=>'Množství zboží v aktu