e code.'=>'Unikátní kód kuponu.','Total tax removed due to discount from applied coupons.'=>'Celková daň odečtená díky slevám z uplatněných kuponů.','The ID of the payment method being used to process the payment.'=>'ID způsobu platby použitého pro zpracování platby.','Result of payment processing, or null if not yet processed.'=>'Výsledek zpracování platby, nebo null, pokud zatím nebyla zpracována.','Returns number of products within attribute terms.'=>'Vrátí počet produktů v rámci výrazů vlastnosti.','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'"%s" již byl použit and nemůže být použit společně s jinými.','Method not implemented'=>'Neimplementovaná metoda','First line of the address being shipped to.'=>'První řádek doručovací adresy.','Second line of the address being shipped to.'=>'Druhý řádek doručovací adresy.','City of the address being shipped to.'=>'Město doručovací adresy.','ISO code for the country of the address being shipped to.'=>'ISO kód země doručovací adresy.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO kód nebo název státu, provincie či okresu doručovací adresy.','Zip or Postcode of the address being shipped to.'=>'Doručovací PSČ.','"%s" is an invalid coupon code.'=>'"%s" je neplatný kód kopónu.','New quantity of the item in the cart.'=>'Nové množství zboží v košíku.','Data to pass through to the payment method when processing payment.'=>'Údaje, které je třeba předat platební metodě při zpracování platby.','Cart item no longer exists or is invalid.'=>'Položka v košíku již neexistuje nebo je neplatná.','Unique identifier (key) for the cart item.'=>'Jedinečný identifikátor (klíč) pro položku v košíku.','Unique identifier (key) for the cart item to update.'=>'Jedinečný identifikátor (klíč) pro položku v košíku k aktualizaci.','Sort ascending or descending.'=>'Seřadit vzestupně nebo sestupně.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Omezit sadu výsledků produktů na základě maximální ceny poskytované za použití nejmenší jednotky měny.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Omezit sadu výsledků na produkty na základě minimální ceny poskytované za použití nejmenší jednotky měny.','Customer ID if registered. Will return 0 for guests.'=>'ID zákazníka, pokud je zaregistrován. Pro hosty vrátí 0.','Note added to the order by the customer during checkout.'=>'Poznámka přidaná k objednávce zákazníkem při placení.','Order key used to check validity or protect access to certain order data.'=>'Klíč objednávky používaný ke kontrole platnosti nebo ochraně přístupu k určitým údajům objednávky.','Order status. Payment providers will update this value after payment.'=>'Stav objednávky. Poskytovatelé plateb tuto hodnotu po zaplacení aktualizují.','The order ID to process during checkout.'=>'ID objednávky ke zpracování během placení.','Cart item is invalid.'=>'Položka košíku je neplatná.','Cannot create order from empty cart.'=>'Nelze vytvořit objednávku z prázdného košíku.','The chosen rate ID for the package.'=>'Zvolené ID sazby pro balíček.','Limit result set to reviews from specific product IDs.'=>'Omezit sadu výsledků na recenze z konkrétních ID produktů.','Limit result set to reviews from specific category IDs.'=>'Omezit sadu výsledků na recenze z ID konkrétní kategorie.','Price string formatted as HTML.'=>'Cenový řetězec naformátovaný jako HTML.','Price data provided using the smallest unit of the currency.'=>'Údaje o ceně poskytované s použitím nejmenší jednotky měny.','Product full description in HTML format.'=>'Celý popis produktu ve formátu HTML.','Product short description in HTML format.'=>'Krátký popis produktu ve formátu HTML.','ID of the parent product, if applicable.'=>'ID nadřazeného produktu, je-li k dispozici.','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; není možné zakoupit.','List of variation IDs, if applicable.'=>'Seznam ID variant, je-li k dispozici.','Parent term ID, if applicable.'=>'ID nadřazeného výrazu, je-li k dispozici.','Quantity left in stock if stock is low, or null if not applicable.'=>'Množství ponechané na skladě, pokud je skladem, nebo nulové, pokud není použitelné.','The %s payment gateway is not available.'=>'Platební brána %s není k dispozici.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kupon "%1$s" byl odstraněn z Vašeho košíku: %2$s','Coupon code "%s" has already been applied.'=>'Kód kuponu "%s" již byl použit.','Invalid coupons were removed from the cart: "%s"'=>'Z košíku byly odstraněny neplatné kupony: "%s"','Coupon does not exist in the cart.'=>'Kupon v košíku neexistuje.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kupon nelze odebrat, protože ještě není v košíku použit.','Invalid coupon code.'=>'Neplatný kupon.','Coupons are disabled.'=>'Kupony jsou vypnuty.','Unique identifier for the coupon within the cart.'=>'Jedinečný identifikátor kuponu v rámci košíku.','No payment method provided.'=>'Nebyl zadán žádný způsob platby.','Invalid payment result received from payment method.'=>'Způsob platby vrátil neplatný výsledek.','If true, empty terms will not be returned.'=>'Pokud je to pravda, prázdné výrazy nebudou vráceny.','Sort by term property.'=>'Seřadit podle hodnoty výrazu.','Collect and validate EU VAT numbers at checkout'=>'Uložit a zkontrolovat DIČ na pokladně','Verify database'=>'Ověřit databázi','Clear template cache'=>'Vymazat mezipaměť šablony','This tool will empty the template cache.'=>'Tento nástroj vyprázdní mezipaměť šablony.','Verify base database tables'=>'Ověřit základní tabulky databáze','Verify if all base database tables are present.'=>'Ověří, zda jsou přítomny všechny základní databázové tabulky.','First order received'=>'První přijatá objednávka','Database verified successfully.'=>'Databáze úspěšně ověřena.','Invalid category ID.'=>'Neplatné ID kategorie.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maximální počet položek, které mají být vráceny v sadě výsledků. Výchozí nastavení je bez omezení, pokud je ponecháno prázdné.','You need WooCommerce 4.2 or newer to run this tool.'=>'Ke spuštění tohoto nástroje potřebujete WooCommerce 4.2 nebo novější.','Verifying database... One or more tables are still missing: '=>'Ověření databáze... Jedna nebo více tabulek stále chybí:','Template cache cleared.'=>'Mezipaměť šablon vymazána.','The active version of WooCommerce does not support template cache clearing.'=>'Aktivní verze WooCommerce nepodporuje čištění mezipaměti šablon.','Get real-time order alerts anywhere'=>'Získejte upozornění na objednávky v reálném čase kdekoli','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Získejte oznámení o aktivitě obchodu, včetně nových objednávek a recenzí produktů přímo na mobilních zařízeních s aplikací Woo.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Pokud váš obchod sídlí v EU, doporučujeme kromě automatických daní použít také rozšíření o DIČ pro EU. Poskytuje vaši pokladnu s polem pro shromažďování a ověřování DIČ zákazníka v EU, pokud ho má.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s vytvoření tabulky se nezdařilo. Má uživatel %2$s oprávnění tvořit v databázi %3$s?','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Tento videonávod Vám pomůže projít procesem přidáníVašeho prvního produktu do WooCommerce.','Do you need help with adding your first product?'=>'Potřebujete pomoc s přidáním prvního produktu?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Spuštění módního webu je vzrušující, ale také se může zdát ohromující. V tomto článku Vás provedeme procesem instalace, naučíme Vás vytvářet úspěšné výpisy produktů a ukážeme Vám, jak oslovit Vaše ideální publikum.','Start your online clothing store'=>'Založte si online obchod s oblečením','The admin note layout has a wrong prop value.'=>'Rozložení poznámky administrátora má nesprávnou hodnotu prop.','Share feedback'=>'Sdílet feedback','Watch tutorial'=>'Zkouknout tutoriál','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Nyní, když jste si nás vybrali jako partnera, je naším cílem zajistit, abychom poskytovali správné nástroje, které vyhoví Vašim potřebám. Těšíme se na Vaši zpětnou vazbu k nastavení obchodu, abychom ji mohli v budoucnu vylepšit.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Změna platforem eCommerce se může zdát jako velká překážka, kterou je třeba překonat, ale je snazší, než si myslíte, přesunout své produkty, zákazníky a objednávky do WooCommerce je snadné. Tento článek Vám pomůže projít tímto procesem.','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Předplatné WooCommerce Vám umožňuje zavést řadu předplatných pro fyzické nebo virtuální produkty a služby. Vytvářejte kluby podle měsíce, týdenní předplatné služeb nebo dokonce roční softwarové fakturační balíčky. Přidejte registrační poplatky, nabídněte bezplatné zkušební verze nebo nastavte doby platnosti.','Do you want to migrate from Shopify to WooCommerce?'=>'Chcete přejít z Shopify na WooCommerce?','Kisumu'=>'Kisumu','Mombasa'=>'Mombasa','Visitors'=>'Návštěvníci','Views'=>'Zobrazení','Features'=>'Vlastnosti','Baringo'=>'Baringo','Bomet'=>'Bomet','Bungoma'=>'Bungoma','Elgeyo-Marakwet'=>'Elgeyo-Marakwet','Embu'=>'Embu','Garissa'=>'Garissa','Homa Bay'=>'Homa Bay','Isiolo'=>'Isiolo','Kajiado'=>'Kajiado','Kakamega'=>'Kakamega','Kericho'=>'Kericho','Kiambu'=>'Kiambu','Kilifi'=>'Kilifi','Kirinyaga'=>'Kirinyaga','Kisii'=>'Kisii','Kitui'=>'Kitui','Kwale'=>'Kwale','Laikipia'=>'Laikipia','Lamu'=>'Lamu','Machakos'=>'Machakos','Makueni'=>'Makueni','Mandera'=>'Mandera','Marsabit'=>'Marsabit','Meru'=>'Meru','Migori'=>'Migori','Murang’a'=>'Murang’a','Nairobi County'=>'Nairobi County','Nakuru'=>'Nakuru','Nandi'=>'Nandi','Narok'=>'Narok','Nyamira'=>'Nyamira','Nyandarua'=>'Nyandarua','Nyeri'=>'Nyeri','Samburu'=>'Samburu','Siaya'=>'Siaya','Taita-Taveta'=>'Taita-Taveta','Tana River'=>'Tana River','Tharaka-Nithi'=>'Tharaka-Nithi','Trans Nzoia'=>'Trans Nzoia','Turkana'=>'Turkana','Uasin Gishu'=>'Uasin Gishu','Vihiga'=>'Vihiga','Wajir'=>'Wajir','West Pokot'=>'Západní Pokot','Not enough units of %s are available in stock to fulfil this order.'=>'Již nemáme dostatečný počet kusů %s skladem, abychom mohli dokončit vaši objednávku. Upravte, prosím, množství tohoto produktu ve vašem košíku.','Registers whether the note is deleted or not'=>'Eviduje, byla-li poznámka smazána nebo ne','Do you need more info about WooCommerce Subscriptions?'=>'Potřebujete více informací o předplatném WooCommerce?','There was a problem activating some of the requested plugins.'=>'Při aktivaci některých požadovaných pluginů došlo k problému.','Plugins wer