atabase tables were missing. Attempting to re-create the missing table(s).'=>'Zdá se, že chybí jedna nebo více databázových tabulek. Snažím se znovu o vytvoření.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Váš obchod je nakonfigurovaný tak, aby nabízel digitální produkty na základě "Redirect only" metody. Tato metoda je zastaralá, <a href="%s">přejděte prosím na jinou metodu</a>.<br><em>Pokud používáte vzdálený server pro stahování souborů (jako například Google Drive, Dropbox, Amazon S3), správná metoda se použije automaticky, takže stačí vybrat jakoukoliv jinou možnost a toto oznámení zmizí.</em>','Choose theme'=>'Vybrat šablonu','Get started'=>'Začínáme','Mobile app'=>'Mobilní aplikace','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Posílejte cílené kampaně, obnovujte opuštěné košíky a mnoho dalšího s Mailchimpem.','Set up payments'=>'Nastavit platby','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Bezpečné přijímání kreditních a debetních s jednou nízkou sazbou a bez překvapujících poplatků (dostupné vlastní sazby). Prodávejte online a v obchodě sledujte prodeje a sklady na jednom místě.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Vyberte platbu kterou chcete, zaplatit teď, zaplatit později nebo to rozdělit. Žádná čísla kreditních karet, žádná hesla, žádné starosti.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Příjem debetních a kreditních karet ve 135+ měnách, způsoby jako Alipay a jedno dotyková platba s Apple Pay.','Store connected successfully.'=>'Stripe byl úspěšně připojen.','Import your products'=>'Importovat demo produkty','Close dialog'=>'Zavřít dialog','Dismiss this notice'=>'Odmítněte toto upozornění','Average order value'=>'Průměrná hodnota objednávky','🎉 Congrats on adding your first product!'=>'🎉 Gratulujeme k přidání prvního produktu!','Gross sales'=>'Hrubé tržby','Customer type'=>'Typ zákazníka','Amount'=>'Množství','Edit Order'=>'Upravit objednávku','Edit Product'=>'Upravit produkt','IP address.'=>'IP adresa.','Plugin name.'=>'Název pluginu.','Analytics'=>'Analytiky','Food and drink'=>'Potraviny a nápoje','Physical products'=>'Fyzické produkty','Memberships'=>'Členství','Bookings'=>'Rezervace','Disable'=>'Zakázat','[deleted]'=>'[smazáno]','Download your %1$s Report: %2$s'=>'Stáhněte si svůj přehled%1$s: %2$s','Invalid request. Please pass the match parameter.'=>'Neplatná žádost. Předejte prosím parametr shody.','A partial IP address can be passed and matching results will be returned.'=>'Může být předána částečná adresa IP a budou vráceny odpovídající výsledky.','There was an error connecting to Square.'=>'Při připojování k Square došlo k chybě.','Plugin status.'=>'Stav pluginu.','Action that should be completed to connect Jetpack.'=>'Akce, která by měla být dokončena pro připojení Jetpack.','Download your %s Report'=>'Stáhnout %s report','Fashion, apparel, and accessories'=>'Móda, oblečení a doplňky','Health and beauty'=>'Zdraví a krása','Electronics and computers'=>'Elektronika a počítače','Home, furniture, and garden'=>'Dům, nábytek a zahrada','CBD and other hemp-derived products'=>'CBD a další produkty získané z konopí','Profile Setup Wizard'=>'Průvodce nastavením profilu','Task List'=>'Seznam úkolů','If you need to enable or disable the task lists, please click on the button below.'=>'Pokud potřebujete povolit