rd %3$s z %4$s.','Statuses that should not be included when calculating report totals.'=>'Stavy, které by neměly být zahrnuty do výpočtu součtů sestav.','Statuses that require extra action on behalf of the store admin.'=>'Stavy, které vyžadují zvláštní akci jménem správce obchodu.','Default Date Range'=>'Výchozí časové období','The admin note name prop cannot be empty.'=>'Název poznámky administrátora nesmí být prázdný.','The admin note type prop (%s) is not one of the supported types.'=>'Typ poznámky administrátora ( %s) není jedním z podporovaných typů.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Import již probíhá. Před zahájením nového importu povolte dokončení předchozího importu.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Data tabulky sestav se znovu sestavují. Počkejte prosím, než se data zcela naplní.','Report table data is being deleted.'=>'Data tabulky sestav se mažou.','Report sync schedulers should be derived from the Automattic\\WooCommerce\\Internal\\Admin\\Schedulers\\ImportScheduler class.'=>'Plánovače synchronizace výkazů by měly být odvozeny ze třídy Automattic\\WooCommerce\\Admin\\Schedulers\\ImportScheduler.','The admin note content prop cannot be empty.'=>'Rekvizita obsahu poznámky správce nemůže být prázdná.','The admin note content_data prop must be an instance of stdClass.'=>'Poznámka správce content_data prop musí být instancí stdClass.','The admin note date prop cannot be empty.'=>'Rekvizita data poznámky správce nemůže být prázdná.','The admin note locale prop cannot be empty.'=>'Podpěra národního prostředí správce nemůže být prázdná.','The admin note source prop cannot be empty.'=>'Rekvizita zdroje poznámky správce nemůže být prázdná.','The admin note status prop (%s) is not one of the supported statuses.'=>'Rekvizita stavu poznámky správce (%s) není jedním z podporovaných stavů.','The admin note status prop cannot be empty