uay','Presidente Hayes'=>'Prezident Hayes','Amambay'=>'Amambay','Central'=>'Central','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Sud Sardegna'=>'Sud Sardegna','Kilograms'=>'Kilogramy','%d API key permanently revoked.'=>'%d klíč API byl trvale zrušen.' . "\0" . '%d klíče API byly trvale zrušeny.' . "\0" . '%d klíčů API bylo trvale zrušeno.','Apartment, suite, unit, etc.'=>'Např. číslo vchodu, firma, patro...','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Tuto akci nejde vrátit. Jste si jisti, že chcete smazat osobní data z vybraných objednávek?','Cannot set attributes due to invalid parent product.'=>'Nemůžete nastavit vlastnosti, kvůli neplatnému nadřazenému produktu.','shipping packagesShipping %d'=>'Doprava %d','Shipping Address'=>'Doručovací adresa','Billing Address'=>'Fakturační adresa','Shipping Address 1'=>'Doručovací adresa 1','Billing Address 1'=>'Fakturační adresa 1','Payer first name'=>'Křestní jméno plátce','Payer last name'=>'Příjmení plátce','Payer PayPal address'=>'PayPal adresa plátce','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Je potřeba, aby vaše CSV obsahovalo sloupce v určitém pořadí. %1$sKlikněte zde pro stažení vzoru%2$s.','MySQL version string.'=>'Řetězec MySQL verze.','privacy policy'=>'ochrana osobních údajů','eCheck ending in %1$s'=>'eŠek končící na %1$s','United States (US) dollar'=>'Americký dolar','terms and conditions'=>'obchodní podmínky','This will be how your name will be displayed in the account section and in reviews'=>'Tímto způsobem se bude zobrazovat vaše jméno ve vašem účtu a v komentářích','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal umožňuje vložit pouze jednu adresu. Pokud používáte PayPal pro přepravní štítky, měl