ation you provide us. For example, both Administrators and Shop Managers can access:'=>'K informacím, které nám poskytnete, mají přístup členové našeho týmu. Například jak Administrátoři, tak Manažeři obchodu mají přístup k:','Who on our team has access'=>'Kdo z našeho týmu má přístup','We will also store comments or reviews, if you choose to leave them.'=>'Budeme rovněž uchovávat komentáře či recenze, pokud se je rozhodnete zveřejnit.','Customer information like your name, email address, and billing and shipping information.'=>'Informace o zákazníkovi jako jsou vaše jméno, e-mailová adresa, fakturační a doručovací adresa.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Členové našeho týmu mají přístup k těmto informacím, aby pomohli zpracovávat objednávky, refundace a poskytovali podporu zákazníkům.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Vaše informace obvykle ukládáme po dobu, po kterou je potřebujeme k účelům, pro které je sbíráme a používáme, dokud jsme povinni je uchovávat. Například informace o objednávce uchováváme po dobu XXX let pro daňové a účetní účely. Tyto údaje zahrnují Vaše jméno, e-mail, fakturační a doručovací adresu.','Respond to your requests, including refunds and complaints'=>'Odpovědět na vaše požadavky včetně vrácení peněz a reklamací','Process payments and prevent fraud'=>'Zpracovat platbu a předejít podvodům','Set up your account for our store'=>'Nastavit váš účet v našem obchodě','Send you information about your account and order'=>'Zaslat informace o vašem účtu a objednávce','Send you marketing messages, if you choose to receive them'=>'Zasílat marketingové zprávy 