n completed orders'=>'Zachovat dokončené objednávky','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Zachovat dokončené objednávky po určitou dobu než v nich budou osobní údaje anonymizovány.','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Čekající objednávky nejsou zaplaceny a mohou být zákazníkem opuštěny. Tyto objednávky budou po nastavené době smazány.','Retain failed orders'=>'Zachovat selhalé objednávky','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Selhalé objednávky nejsou zaplaceny a mohou být zákazníkem opuštěny. Tyto objednávky budou po nastavené době smazány.','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Je dostupná nová verze WordPress (%2$s)','WordPress multisite'=>'WordPress multisite','WordPress memory limit'=>'WordPress memory limit','WordPress debug mode'=>'WordPress debug mode','WordPress cron'=>'WordPress cron','External object cache'=>'Externí objektová cache','Displays whether or not WordPress is using an external object cache.'=>'Zobrazení zda WordPress používá externí objektovou cache.','WooCommerce version'=>'Verze WooCommerce','WordPress version'=>'Verze WordPress','Legacy API'=>'Legacy API','Manage'=>'Spravovat','Rates will be configurable and taxes will be calculated during checkout.'=>'Ceny budou konfigurovatelné a DPH bude vypočteno v pokladně.','Enable tax rates and calculations'=>'Povolení sazeb DPH a jejich výpočtů','Account endpoints'=>'Koncové body účtu','Secure checkout'=>'Zapnout zabezpečení pokladny','Enable coupons'=>'Povolit kupony','Settings tab labelPayments'=>'Platby','Optionally add some text about your store privacy policy to show during checkout.'=>'Volitelně vložte nějaký text o vašich zásadách ochrany osobních údajů, který se zobrazí při průchodu pokladnou.','Privacy policy'=>'Zása