ct pages. These images will remain uncropped.'=>'Velikost obrázku použitá pro hlavní obrázek na stránce jednoduchého produktu. Tyto obrázky zůstanou neoříznuté.','Invalid permission ID.'=>'Neplatné ID oprávnění.','Municipality / District'=>'Obec / kraj','%s is not a valid postcode / ZIP.'=>'%s není platné PSČ.','Search logs'=>'Hledat logy','Shop pages'=>'Stránky obchodu','Filter by IP address'=>'Filtrovat podle IP adresy','Filter by user'=>'Filtrovat podle uživatele','Filter by order'=>'Filtrovat podle objednávky','Filter by file'=>'Filtrovat podle souboru','Filter by product'=>'Filtrovat podle produktu','Permission ID'=>'ID oprávnění','File ID'=>'ID souboru','Set Status - On backorder'=>'Nastavit stav - Na objednávku','View report'=>'Zobrazit přehled','Copy link'=>'Kopírovat odkaz','Status:'=>'Stav:','Date created:'=>'Datum vytvoření:','Filter by stock status'=>'Filtrovat podle stavu skladu','On backorder'=>'Na objednávku','Error processing refund. Please try again.'=>'Chyba vrácení objednávky. Prosím zkuste to znovu.','Download ID.'=>'ID stahování.','No customer downloads found.'=>'Nenalezeno žádné stahování zákazníka.','Confirm navigation'=>'Potvrdit navigaci','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Odkaz na report expiroval. %1$sKlikněte pro zobrazení filtrovaného reportu%2$s.','Customer download log'=>'Log stahování pro zákazníka','Copying to clipboard failed. You should be able to right-click the button and copy.'=>'Kopírování do schránky selhalo. Mělo by být dostupné po kliknutí pravým tlačítkem myši.','Postcodes containing wildcards (e.g. CB23*) or fully numeric ranges (e.g. <code>90210...99000</code>) are also supported. Please see the shipping zones <a href="%s" target="_blank">documentation</a> for more information.'=>'Poštovní směrovací čísla se zástupnými znaky  (e.g. CB23*) nebo číselnými rozsahy e.g. <code>90210...99000</code>) jsou podporovány. Prosím, přečtěte si <a href="%s" target="_blank">dokumentaci dopr