nota skladu. Produkt %1$d má %2$d položek skladem.','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Níže je uveden seznam rozšíření dostupných na vašem účtu WooCommerce.com. Chcete-li dostávat aktualizace rozšíření, ujistěte se, že je rozšíření nainstalováno a jeho předplatné je aktivováno a připojeno k vašemu účtu WooCommerce.com. Rozšíření lze aktivovat z obrazovky <a href="%s">Pluginy</a> .','Send order details to customer'=>'Odeslat podrobnosti objednávky zákazníkovi','Refund #%1$s - %2$s by %3$s'=>'Vratka č. %1$s - %2$s od %3$s','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Pokud máte rádi %1$s prosím ohodnoťte nás %2$s. Velice děkujeme!','Expiring Soon'=>'Brzy vyprší','Expired'=>'Vypršelo','Transfer existing products to your new store — just import a CSV file.'=>'Přesunout existující produkty do vašeho nového obchodu — import CSV souboru.','Update Available'=>'Aktualizace je k dispozici','Import products'=>'Importovat produkty','Create a product'=>'Vytvořit produkt','Have an existing store?'=>'Máte již existující obchod?','Yes please!'=>'Ano prosím!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Jsme tu pro vás — získejte tipy, aktualizace produktů a inspiraci přímo do své schránky.','You\'re ready to start selling!'=>'Můžete začít prodávat!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Váš web je možná soukromý. Jetpack se umí spojit pouze s veřejnými weby. Ujištěte se, že vaše stránka je viditelná na internetu a zkuste se znovu spojit.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure t